// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "./SyndicateClosedEndFundLogic.sol";

/// @author Syndicate Inc.
/// @notice Handle member deposit accounting and ERC20 transfers
contract SyndicateClosedEndFundDepositLogicV0 is SyndicateClosedEndFundLogic {
    using SafeERC20 for IERC20;

    // Storage------------------------------------------------------------------

    /// @notice Used to initialize the Syndicate contract.
    constructor(address storeAddress)
        SyndicateClosedEndFundLogic(storeAddress)
    {}

    // Events-------------------------------------------------------------------

    /// @notice Emit an event when a manager sets a new minimum deposit amount
    /// per wallet address
    event managerSetterDepositMinMember(
        address indexed syndicateAddress,
        uint256 depositMinMember
    );

    /// @notice Emit an event when a manager sets a new maximum deposit amount
    /// per wallet address
    event managerSetterDepositMaxMember(
        address indexed syndicateAddress,
        uint256 depositMaxMember
    );

    /// @notice Emit an event when a manager sets a new maximum total deposit
    /// amount
    event managerSetterDepositMaxTotal(
        address indexed syndicateAddress,
        uint256 depositMaxTotal
    );

    /// @notice Emit an event when a member deposits to a Syndicate
    /// @dev This is the only way to search for a member's Syndicates. The
    /// Syndicates on chain rely on a mapping, so they are not iterable.
    /// Instead, it's necessary to search through an indexed memberAddress
    /// off-chain to get a list of a member's Syndicates for screens such as the
    /// My Syndicates screen.
    /// @dev This must be reconciled with `memberWithdrewDeposit` events to get
    /// a list of all Syndicates for which a member has a nonzero deposit.
    event memberDeposited(
        address indexed syndicateAddress,
        address indexed memberAddress,
        uint256 amountDeposited,
        uint256 timestamp
    );

    /// @notice Emit an event when a member withdraws a deposit from a
    /// Syndicate. If a member withdraws the full amount that they originally
    /// deposited, then they no longer have any holdings in that Syndicate.
    /// @dev A different event is emitted for withdrawing distributions
    event memberWithdrewDeposit(
        address indexed syndicateAddress,
        address indexed memberAddress,
        address indexed depositERC20Address,
        uint256 amountWithdrawn,
        uint256 timestamp
    );

    /// @notice Emit an event when a manager overrides a member's balance
    /// with a new value. Applicable to `modifiable` Syndicates only.
    /// @dev The balance emitted is the new value, not the change in value
    event managerSetterDepositForMember(
        address indexed syndicateAddress,
        address indexed memberAddress,
        uint256 depositMember,
        uint256 timestamp
    );

    /// @notice Emit an event when a manager rejects a member's deposit
    event managerRejectedDepositForMember(
        address indexed syndicateAddress,
        address indexed memberAddress,
        address indexed depositERC20Address,
        uint256 amountWithdrawn,
        uint256 timestamp
    );

    // Functions----------------------------------------------------------------

    /// @notice Set the minimum deposit per wallet address. This is the minimum
    /// that a single member can contribute to the Syndicate
    /// @param syndicateAddress The address of the Syndicate
    /// @param depositMinMember The minimum deposit amount per member. Must not
    /// exceed the current `depositMaxMember`.
    function managerSetDepositMinMember(
        address syndicateAddress,
        uint256 depositMinMember
    ) public onlyManager(syndicateAddress) onlyOpen(syndicateAddress) {
        require(
            depositMinMember <= store.depositMaxMember(syndicateAddress),
            "MIN_MBR_DEP>MAX_MBR_DEP"
        );

        store.setDepositMinMember(syndicateAddress, depositMinMember);

        emit managerSetterDepositMinMember(syndicateAddress, depositMinMember);
    }

    /// @notice Set the maximum deposit per wallet address. This is the maximum
    /// that a single member can contribute to the Syndicate
    /// @param syndicateAddress The address of the Syndicate
    /// @param depositMaxMember The maximum deposit amount per user. Must be at
    /// least the current `depositMinMember`, and cannot exceed the current
    /// `depositMaxTotal`.
    function managerSetDepositMaxMember(
        address syndicateAddress,
        uint256 depositMaxMember
    ) public onlyManager(syndicateAddress) onlyOpen(syndicateAddress) {
        require(
            depositMaxMember >= store.depositMinMember(syndicateAddress),
            "MAX_MBR_DEP<MIN_MBR_DEP"
        );
        require(
            depositMaxMember <= store.depositMaxTotal(syndicateAddress),
            "MAX_MBR_DEP>MAX_TOT_DEP"
        );

        store.setDepositMaxMember(syndicateAddress, depositMaxMember);

        emit managerSetterDepositMaxMember(syndicateAddress, depositMaxMember);
    }

    /// @notice Set the maximum total deposit amount. This is the maximum
    /// that all members combined can contribute to the Syndicate
    /// @param syndicateAddress The address of the Syndicate
    /// @param depositMaxTotal The maximum total number of deposits. Must be
    /// at least the current `depositMaxMember`.
    /// @notice `depositMaxTotal` is not required to be at least `depositTotal`.
    /// Setting `depositMaxTotal` to be less than `depositTotal` can be thought
    /// of as a simple way to cut off deposits if the Syndicate has grown too
    /// large.
    function managerSetDepositMaxTotal(
        address syndicateAddress,
        uint256 depositMaxTotal
    ) public onlyManager(syndicateAddress) onlyOpen(syndicateAddress) {
        require(
            depositMaxTotal >= store.depositMaxMember(syndicateAddress),
            "MAX_TOT_DEP<MAX_MBR_DEP"
        );

        store.setDepositMaxTotal(syndicateAddress, depositMaxTotal);

        emit managerSetterDepositMaxTotal(syndicateAddress, depositMaxTotal);
    }

    /// @notice Used by a member to make a deposit to an open Syndicate.
    /// @param syndicateAddress The Syndicate that a member is depositing to
    /// @param amount The amount of the deposit (note that this is calculated
    /// using the Syndicate's primary ERC20 token)
    /// @notice If a manager is issuing a Syndicate under SEC Rule 506(b) of
    /// Regulation D, a manager should only add a member's address(es) to the
    /// allowlist if the member attests that they are an accredited investor.
    /// This is also highlighted in the web interface, but it is not a
    /// requirement of the smart contract since not all Syndicates are
    /// securities, nor are all Syndicates that are securities necessarily
    /// 506(b) offerings (they could be 506(c) offerings for example).
    /// @notice Under Rule 506(b), up to 35 non-accredited investors can invest
    /// in a private placement. These non-accredited investors must have
    /// sufficient knowledge and experience, which is difficult to verify in a
    /// decentralized context. As a result, we leave it up to the Syndicate
    /// manager to track their own list of up to 35 non-accredited investors and
    /// add them to the allowlist. The Syndicate manager must provide
